import logo from './logo.svg';
import './App.css';


import React, { useState, useEffect, Component } from "react";
import axios from 'axios'

const api = axios.create({ "baseURL":'' });

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
			loading: false,
			tableList: [
				// {
				// 	storyDescription: 'Create the spec sheet for the customer meeting', 
				// 	jobType: 'Requirements', 
				// 	developerRole: 'Business Analyst', 
				// 	storypoints: 8, 
				// 	Hours: 20, 
				// 	HourlyRate: 90, 
				// 	Cost: 1800, 
				// 	numberOfPeople: 1 
				// },
				// {
				// 	storyDescription: 'Push the code into the TFS pipe and run the ML code', 
				// 	jobType: 'Pipeline Push', 
				// 	developerRole: 'Machine learning Engineer', 
				// 	storypoints: 13, 
				// 	Hours: 25, 
				// 	HourlyRate: 210, 
				// 	Cost: 5250, 
				// 	numberOfPeople: 2 
				// }
			],
			row: {},
			default: {
				storyDescription: 'Create the spec sheet for the customer meeting', 
				jobType: 'Requirements', 
				developerRole: 'Business Analyst', 
				storypoints: 8, 
				Hours: 20, 
				HourlyRate: 90, 
				Cost: 1800, 
				numberOfPeople: 1 
			}
		}

		this.getUserStory = this.getUserStory.bind(this);
		this.Add = this.Add.bind(this);
		this.Delete = this.Delete.bind(this);
		this.Predict = this.Predict.bind(this);
	}

	getUserStory(e, callback) {
		let user_story = e.currentTarget.value;
		let url = `https://ff-loogle.azurewebsites.net/api/loggle-api?code=fzX42rtSSwBfWFZ9eoSPt7DdId_Csp8HUueCkJrmC6mfAzFuh7r8nA==&user_story=${user_story}`;
		let url_test = `https://ff-loogle.azurewebsites.net/api/loggle-api-test?code=OlOw0fXe72e2HdcqruqhSt7ex0aZTFrXyezjh7YvH7G8AzFu3ziPLg==&user_story=${user_story}`

		this.setState({ loading: true });
		let axiosConfig = {
			headers: {
				'Accept': 'Token',
				"Access-Control-Allow-Origin": "*",
				"Content-Type" : "application/x-www-form-urlencoded; charset=UTF-8",
				"Access-Control-Allow-Headers": "Origin, X-Requested-With, Content-Type, Accept, Authorization",
				"Host": "https://ff-loogle.azurewebsites.net",
				"Origin": "https://ff-loogle.azurewebsites.net",
				"Referer": "https://ff-loogle.azurewebsites.net"
			}
		};

		api({
			method: 'get',
			url: url_test,
			headers: axiosConfig,
			data: { }
		}).then(response => { 
			this.setState({ loading: false });

			console.log(response);
			if (typeof callback === "function") {
				callback(response);
			}
		});
	}


	Add() {
		let row = JSON.parse(JSON.stringify(this.state.row));
		let newTable = JSON.parse(JSON.stringify(this.state.tableList));
		let leng = newTable.length;
		newTable.push(row);
		this.setState({ tableList: newTable });

		this.setState({ row: {} })
	}

	Delete(e) {
		let parent = e.currentTarget.parentElement;
		let index = e.currentTarget.getAttribute('index');
		let data = JSON.parse(JSON.stringify(this.state.tableList));
		data.splice(index, 1);
		this.setState({ tableList: data });
	}

	Predict(e) {
		if (e.key == 13 || e.which == 13) {
			let user_story = e.currentTarget.value;
			this.getUserStory(user_story, (res) => {
				let row = JSON.parse(JSON.stringify(this.state.default));
				row.storyDescription = user_story;

				this.setState({ row: row });
				e.currentTarget.value = '';
			});
		}
	}


    render() {

		let tableStyle = {
			width: "100%",
			borderRadius: 10,
			boxShadow: '0px px 10px 10px #00000010',
			border: "1px solid #cecece",
			backgroundColor: "#ece9e9"
		}

		let total_storypoints = 0;
		let total_hours = 0;
		let avg_hourly_rate = 0;
		let total_cost = 0;
		let total_no_people = 0;

		let table = JSON.parse(JSON.stringify(this.state.tableList));
		let job_types_count = [...new Set(table.map(item => item.jobType))].length;
		let dev_role_count = [...new Set(table.map(item => item.developerRole))].length;
		total_storypoints = table.reduce((a, b) => a + (parseFloat(b.storypoints) || 0), 0);
		total_hours = table.reduce((a, b) => a + (parseFloat(b.Hours) || 0), 0);
		avg_hourly_rate = table.reduce((a, b) => a + (parseFloat(b.HourlyRate) || 0), 0) / table.length;
		total_cost = table.reduce((a, b) => a + (parseFloat(b.Cost) || 0), 0);
		total_no_people = table.reduce((a, b) => a + (parseFloat(b.numberOfPeople) || 0), 0);



    	return (

			<div className="App">
				{((this.state.row && Object.keys(this.state.row).includes("storyDescription") && this.state.row.storyDescription != "") || this.state.tableList.length > 0)  &&
					<div style={{ left: 70, top: 25, position: 'absolute', width: "fint-content", display: "inline-flex" }}>
						<div style={{fontSize: 30, fontStyle: "san serif", fontWeight: 600, marginBottom: 30, paddingRight: 40 }}>
							<span style={{ color: '#4285f4' }}>L</span>
							<span style={{ color: '#ea4335' }}>o</span>
							<span style={{ color: '#fbbc05' }}>o</span>
							<span style={{ color: '#4285f4' }}>g</span>
							<span style={{ color: '#34a853' }}>l</span>
							<span style={{ color: '#ea4335' }}>e</span>
						</div>
					<div>
						<input style={{ width: "50%", left: "25%", maxWidth: 500, minWidth: 500, height: 30, borderRadius: 40, 
							boxShadow: '0px 5px 2px 0px #00000010', padding: 10, paddingLeft: 20, paddingRight: 20,
							fontSize: 20, border: "1px solid #cecece"
							}} 
							onKeyUp ={this.Predict}
							type="text" 
							placeholder="Chat user stories ..." />

						</div>
				</div>}

				{((!Object.keys(this.state.row).includes("storyDescription") || this.state.row.storyDescription == "") && this.state.tableList.length == 0 )  && 
				<div style={{ top: "25%", position: 'absolute', width: "100%" }}>
					<div style={{fontSize: 80, fontStyle: "san serif", fontWeight: 600, marginBottom: 30 }}>
					<span style={{ color: '#4285f4' }}>L</span>
					<span style={{ color: '#ea4335' }}>o</span>
					<span style={{ color: '#fbbc05' }}>o</span>
					<span style={{ color: '#4285f4' }}>g</span>
					<span style={{ color: '#34a853' }}>l</span>
					<span style={{ color: '#ea4335' }}>e</span>
					</div>
					<div>
						<input style={{ width: "50%", left: "25%", maxWidth: 600, minWidth: 400, height: 30, borderRadius: 40, 
							boxShadow: '0px 5px 1px 0px #00000010', padding: 10, paddingLeft: 20, paddingRight: 20,
							fontSize: 20, border: "1px solid #cecece"
							}}
							onKeyUp ={this.Predict}
							 type="text" 
							 placeholder="Chat user stories ..." />

						<div style={{ fontSize: 12, fontWeight: 'normal', position: "absolute", 
								width: "100%", textAlign: 'center' }}>
							<div style={{ textAlign: 'center', display: "inline-flex" }}>
							powered by <span style={{ paddingLeft: 10, paddingRight: 10, fontWeight: 'bold' }}> Frank Frisby </span>  and data source: pretrained GPT 3. model (used API)
							</div>
						</div>
					</div>
				</div>}

				<div style={{ top: 80, position: "absolute", width: "70%", padding: "5%", paddingLeft: 200, paddingRight: "15%" }}>
					{(this.state.row && Object.keys(this.state.row).includes("storyDescription") && this.state.row.storyDescription != "") && 
					<div className='story-table' style={{ marginBottom: 60 }} >
						<table className="table" style={tableStyle}>
							<thead style={{ }}>
								<tr>
									<th>User Story</th>
									<th>Job Type</th>
									<th>Role</th>
									<th>Story Points</th>
									<th>Hours</th>
									<th>Hourly Rate</th>
									<th>Cost</th>
									<th># People</th>
								</tr>
							</thead>
							<tbody style={{ backgroundColor: "#ffffff" }}>
								<tr>
									<td style={{ fontWeight: "bold", textAlign: "left", padding: 8, paddingLeft: 13 }}>{this.state.row.storyDescription}</td>
									<td style={{ textAlign: "left", padding: 8, paddingLeft: 13 }}>{this.state.row.jobType}</td>
									<td style={{ textAlign: "left", padding: 8, paddingLeft: 13 }}>{this.state.row.developerRole}</td>
									<td style={{ textAlign: "center", padding: 8, paddingLeft: 13 }}>{this.state.row.storypoints}</td>
									<td style={{ textAlign: "center", padding: 8, paddingLeft: 13 }}>{this.state.row.Hours}</td>
									<td style={{ textAlign: "center", padding: 8, paddingLeft: 13 }}>${this.state.row.HourlyRate}</td>
									<td style={{ textAlign: "center", padding: 8, paddingLeft: 13 }}>${this.state.row.Cost}</td>
									<td style={{ textAlign: "center", padding: 8, paddingLeft: 13 }}>{this.state.row.numberOfPeople}</td>
									<td style={{ textAlign: "center", padding: 8, paddingLeft: 13, 
											color: "#ffffff", backgroundColor: "green", borderRadius: 8 }} 
										onClick={this.Add}>
											Add
									</td>
								</tr>
							</tbody>
						</table>
					</div>}

					{this.state.tableList.length > 0 && <div className='story-table-list' >
					<h2 style={{ textAlign: "left", marginTop: 0 }}>Project Estimation List</h2>
					<table className="table story-list" style={tableStyle}>
							<thead style={{ }}>
								<tr>
									<th>User Story</th>
									<th>Job Type</th>
									<th>Role</th>
									<th>Story Points</th>
									<th>Hours</th>
									<th>Hourly Rate</th>
									<th>Cost</th>
									<th># People</th>
								</tr>
							</thead>
							<tbody style={{ backgroundColor: "#ffffff" }}>
								{this.state.tableList.map((row, index) => { 
									return (<tr key={index}>
										<td style={{ fontWeight: "bold", textAlign: "left", padding: 8, paddingLeft: 13 }}>{row.storyDescription}</td>
										<td style={{ textAlign: "left", padding: 8, paddingLeft: 13 }}>{row.jobType}</td>
										<td style={{ textAlign: "left", padding: 8, paddingLeft: 13 }}>{row.developerRole}</td>
										<td style={{ textAlign: "center", padding: 8, paddingLeft: 13 }}>{row.storypoints}</td>
										<td style={{ textAlign: "center", padding: 8, paddingLeft: 13 }}>{row.Hours}</td>
										<td style={{ textAlign: "center", padding: 8, paddingLeft: 13 }}>${row.HourlyRate}</td>
										<td style={{ textAlign: "center", padding: 8, paddingLeft: 13 }}>${row.Cost}</td>
										<td style={{ textAlign: "center", padding: 8, paddingLeft: 13 }}>{row.numberOfPeople}</td>									
										<td style={{ textAlign: "center", padding: 8, paddingLeft: 13, 
											 fontSize: 30, borderRadius: 8 }} 
											index={index}
											onClick={this.Delete}>
											&times;
										</td>
									</tr>)
								})}
							</tbody>
							<tfoot>
								<tr>
									<th style={{ textAlign: "left", padding: 8, paddingLeft: 13 }}>Totals</th>
									<th>{job_types_count}</th>
									<th>{dev_role_count}</th>
									<th style={{ textAlign: "center", padding: 8, paddingLeft: 13 }}>{total_storypoints}</th>
									<th style={{ textAlign: "center", padding: 8, paddingLeft: 13 }}>{total_hours}</th>
									<th style={{ textAlign: "center", padding: 8, paddingLeft: 13 }}>${avg_hourly_rate} avg</th>
									<th style={{ textAlign: "center", padding: 8, paddingLeft: 13 }}>${total_cost}</th>
									<th style={{ textAlign: "center", padding: 8, paddingLeft: 13 }}>{total_no_people}</th>
								</tr>
							</tfoot>
						</table>
					</div>}
				</div>
				<div style={{ minHeight: 50, maxHeight: 100, width: "100%", textAlign: "center", position: "absolute", paddingTop: 20, bottom: 0, left: 0, backgroundColor: "#f2f2f2" }}>
					<div style={{ textAlign: "center", padding: 0, fontSize: 14, display: "inline-flex" }}>
					<a style = {{ marginRight: 20 }} target="_blank" href="https://medium.com/quick-code/build-simple-react-js-application-in-5-minutes-f9abfc2d018a">
						App is Built with React
					</a>
					<a style = {{ marginRight: 20 }} target="_blank" href="https://portal.azure.com/#view/WebsitesExtension/FunctionMenuBlade/~/code/resourceId/%2Fsubscriptions%2Fa2ae3e35-a02e-4283-925f-2203a0f804ff%2FresourceGroups%2FFF-DEMO%2Fproviders%2FMicrosoft.Web%2Fsites%2Fff-loogle%2Ffunctions%2Floggle-api">
						API call uses Azure Cloud function
					</a>
					<a style = {{ marginRight: 20 }} target="_blank" href="https://portal.azure.com/#@malukimontgomerycivarmy.onmicrosoft.com/resource/subscriptions/a2ae3e35-a02e-4283-925f-2203a0f804ff/resourceGroups/FF-DEMO/providers/Microsoft.Web/sites/ff-loogle-app/appServices">
						App is hosted on Azure web app
					</a>
					<a style = {{ marginRight: 20 }} target="_blank" href="https://www.tensorflow.org/">
						AI is written in python using Tensorflow
					</a>
					<a style = {{ marginRight: 20 }} target="_blank" href="https://beta.openai.com/playground">
						source Data: OpenAI API Playground
					</a>
					</div>
				</div>
			</div>
        );
	}
}

export default App;
